import * as actionTypes from "../../lib/constants/actionTypes";

const initialState = {
  data:''
};
const getColorsReducer = (state = initialState, action) => {
  switch (action.type) {

    case actionTypes.GET_COLORS:
      return {

        ...state,
        colors: action.payload,
      };

    default:
        return state
  }
};

export default getColorsReducer;
